var contextMenu = document.querySelector('ct-context-menu');

if(contextMenu.opened) {
  contextMenu.toggle();  
}

window.ldr = document.querySelector('activity-loader');
window.ldr.show();

var summonerName = summonerName.trim();
var requestUrl = 'https://euw.api.pvp.net/api/lol/euw/v1.4/summoner/by-name/' + summonerName + '?api_key=09979520-6188-4c81-b771-cad9324504ba';

var req = new XMLHttpRequest();
req.open('GET', requestUrl, true);  
req.setRequestHeader('Content-Type', 'application/json;charset=utf-8');
req.send();

req.onreadystatechange = function(r) {
    if(req.readyState === XMLHttpRequest.DONE && req.status === 200) {      
      var result = JSON.parse(req.response);
      result = result[Object.keys(result)[0]];
      cti.getSummonerData(result);
    }
    else if(req.readyState === XMLHttpRequest.DONE && req.status === 404) {
      console.log('ERROR');
      console.log(req.response);
      window.ldr.hide();
      document.getElementById('popErr').toggle();
    }
}

var requestUrl = 'https://euw.api.pvp.net/api/lol/euw/v1.3/stats/by-summoner/' + summoner.id + '/ranked?season=SEASON2017&api_key=09979520-6188-4c81-b771-cad9324504ba';

var req = new XMLHttpRequest();
req.open('GET', requestUrl, true);  
req.setRequestHeader('Content-Type', 'application/json;charset=utf-8');
req.send();

req.onreadystatechange = function(r) {
    if(req.readyState === XMLHttpRequest.DONE && req.status === 200) {      
      var result = JSON.parse(req.response);
      summoner.results = result;

      if(!cti.store.searches) {
        cti.store.searches = [summoner]; 
      }
      else {
        var exists = false;

        for(var i = 0; i < cti.store.searches.length; i++) {
          var s = cti.store.searches[i];

          if(s.id === summoner.id) {
            exists = true;
            break;
          }
        }

        if(!exists) {
          cti.store.searches.unshift(summoner)
        }
      }

      cti.store.selectedSummoner = summoner;
      window.ldr.hide();
      cti.utils.callAction('go-to-page', { name: 'Results' });
    }
    else if(req.readyState === XMLHttpRequest.DONE && req.status === 404) {
      console.log('ERROR');
      console.log(req.response);
      window.ldr.hide();
      document.getElementById('popErr').toggle();
    }
}

